import React from 'react'; 
import { TextField, Button, Grid, Avatar } from '@material-ui/core';
import { List, ListItem, ListItemAvatar,ListItemText } from '@material-ui/core';
import { ListItemSecondaryAction, IconButton, Typography } from '@material-ui/core';

import DeleteIcon from '@material-ui/icons/Delete';
 
const dummy = 
['탄이','닐라','초코'];

const dummy2 = 
['안보현','박서준','임재범'];

const MyProfile = () =>{
    return(
        <> 
            <div>my page</div> 
            <Grid item md={12}>
                <form style={{marginTop:30}}>
                <TextField id="nickname" label="닉네임" />
                <Button variant="contained" color="primary" disableElevation style={{marginTop:10}}>
                수정</Button>
                </form>
            </Grid>

            <Grid item md={12} style={{marginTop:30}}>
                <Typography variant="h6" >
                    팔로잉 목록
                </Typography>
                <List>  
                {dummy.map((v, i)=>{
                    return(
                        <ListItem>
                            <ListItemAvatar>
                                <Avatar>
                                {v[0]}
                                </Avatar>
                            </ListItemAvatar>
                            <ListItemText
                                primary={v} 
                            />
                            <ListItemSecondaryAction>
                                <IconButton edge="end" aria-label="delete">
                                <DeleteIcon />
                                </IconButton>
                            </ListItemSecondaryAction>
                        </ListItem>    
                    );
                })} 
                </List>
                <Button size="medium">
                더보기
                </Button>
            </Grid>

            <Grid item md={12} style={{marginTop:30}}>
                <Typography variant="h6" >
                    팔로워 목록
                </Typography>
                <List>  
                {dummy2.map((v, i)=>{
                    return(
                        <ListItem>
                            <ListItemAvatar>
                                <Avatar>
                                {v[0]}
                                </Avatar>
                            </ListItemAvatar>
                            <ListItemText
                                primary={v} 
                            />
                            <ListItemSecondaryAction>
                                <IconButton edge="end" aria-label="delete">
                                <DeleteIcon />
                                </IconButton>
                            </ListItemSecondaryAction>
                        </ListItem>    
                    );
                })} 
                </List>
            </Grid>
        </>
    )
}

export default MyProfile;
